In the barycentric coordiante system a point is expressed as the linear combination of multiple vectors. The idea is that you specify vectors \(v_1, v_2, ..., v_n\) and numbers \(\alpha_1, \alpha_2, ..., \alpha_n\). Then the barycentric coordinate specified by these vectors and numbers is \[\frac{\alpha_1 v_1 + \alpha_2 v_2 + \cdots + \alpha_n v_n}{\alpha_1 + \alpha_2 + \cdots + \alpha_n}\] bary: dictionary A dictionary where the key is a named element and the value is a float . The center anchor of the named element is used as \(v\) and the value is used as \(\alpha\) circle((90deg, 3), radius: 0, name: "content")
circle((210deg, 3), radius: 0, name: "structure")
circle((-30deg, 3), radius: 0, name: "form") for (c, a) in ( ("content", "south"), ("structure", "north"), ("form", "north")
) { content(c, align(center, c + [\ oriented]), padding: .1, anchor: a)
} stroke(gray + 1.2pt)
line("content", "structure", "form", close: true) for (c, s, f, cont) in ( (0.5, 0.1, 1, "PostScript"), (1, 0, 0.4, "DVI"), (0.5, 0.5, 1, "PDF"), (0, 0.25, 1, "CSS"), (0.5, 1, 0, "XML"), (0.5, 1, 0.4, "HTML"), (1, 0.2, 0.8, "LaTeX"), (1, 0.6, 0.8, "TeX"), (0.8, 0.8, 1, "Word"), (1, 0.05, 0.05, "ASCII")
) { content( (bary: ( content: c, structure: s, form: f )), cont, fill: rgb(50, 50, 255, 100), stroke: none, frame: "circle" )
}

