Defines a piont relative to a named element using anchors, see Anchors . name: str The name of the element that you wish to use to specify a coordinate. anchor: str or angle or number or ratio or none Default:none The anchor of the element. Strings are named anchors, angles are border anchors and numbers and ratios are path anchors. If not given, the default anchor will be used, on most elements this is center but it can be different or not exsist at all! circle((0,0), name: "circle")
// Anchor at 30 degree
content((name: "circle", anchor: 30deg), box(fill: white, $ 30 degree $))
// Anchor at 30% of the path length
content((name: "circle", anchor: 30%), box(fill: white, $ 30 % $))
// Anchor at 3.14 of the path
content((name: "circle", anchor: 3.14), box(fill: white, $ p = 3.14 $)) You can also use implicit syntax of a dot separated string in the form "name.anchor" for all anchors. line((0, 0), (4, 3), name: "line")
circle("line.75%", name: "circle")
rect("line.start", "circle.east")

