Use this to linearly interpolate between two coordinates a and b with a given distance number. If number is a number the position will be at the absolute distance away from a towards b, a ratio can be given instead to be the relative distance between a and b. An angle can also be given for the general meaning: "First consider the line from a to b. Then rotate this line by angle around point a. Then the two endpoints of this lien will be a and some point c. Use the point c for the subsequent computation." a: coordinate The coordinate to interpolate from. b: coordinate The coordinate to interpolate to. number: ratio or number The distance between a and b. A ratio will be the relative distance between the two points, a number will be the absolute distance between the two points. angle: angle Default:0deg Angle between \(\vec{AB}\) and \(\vec{AP}\), where \(P\) is the resulting coordinate. This can be used to get the normal for a tangent between two points. Can be used implicitly as an array in the form (a, number, b) or (a, number, angle, b). grid((0,0), (3,3), help-lines: true) line((0,0), (2,2), name: "a")
for i in (0%, 20%, 50%, 80%, 100%, 125%) { // Relative distance content(("a.start", i, "a.end"), box(fill: white, inset: 1pt, [#i]))
} line((1,0), (3,2), name: "b")
for i in (0, 0.5, 1, 2) { // Absolute distance content(("b.start", i, "b.end"), box(fill: white, inset: 1pt, text(red, [#i])))
} grid((0,0), (3,3), help-lines: true)
line((1,0), (3,2))
line((1,0), ((1, 0), 1, 10deg, (3,2)))
fill(red)
stroke(none)
circle(((1, 0), 50%, 10deg, (3, 2)), radius: 2pt) grid((0,0), (4,4), help-lines: true) fill(black)
stroke(none)
let n = 16
for i in range(0, n+1) { circle(((2,2), i / 8, i * 22.5deg, (3,2)), radius: 2pt)
} You can even chain them together! grid((0,0), (3, 2), help-lines: true)
line((0,0), (3,2))
stroke(red)
line(((0,0), 0.3, (3,2)), (3,0))
fill(red)
stroke(none)
circle( ( // a (((0, 0), .3, (3, 2))), 0.7, (3,0) ), radius: 2pt
) grid((0,0), (3, 2), help-lines: true)
line((1,0), (3,2))
for (l, c) in ((0cm, "0cm"), (1cm, "1cm"), (15mm, "15mm")) { content(((1,0), l, (3,2)), box(fill: white, $ #c $))
} Interpolation coordinates can be used to get the normal on a tangent: let (a, b) = ((0,0), (3,2))
line(a, b)
